import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src='/wave.png' className="App-logo" alt="logo" />
          <div className='title'><span style={{color:'#61dafb',fontWeight:'500'}}>&lt;</span>harmoni<span style={{color:'#61dafb',fontWeight:'500'}}>&#47;&gt;</span></div>
          <h6>
            automated harmony generator
          </h6>
          <input type='file' name='midiFile'/>
          <a href="http://will.com" target="_blank" rel="noopener noreferrer">
            <button className='buttonPrimary'>HARMONIZE</button>
          </a>
        </header>
      </div>
    );
  }
}

export default App;
